'''Stella Sinistra'''是出自BEMANI系列音乐游戏联动活动《热斗！BEMANI STADIUM》的曲目。


{{Hide|标题=YouTube视频|内容={{#widget:YouTube|id=1hG7fgpwyRA}}}}

== 简介 ==
活动前半战收录乐曲，曲目作者为Akhuta，是Konami旗下的音乐制作人，在2013年Jubeat提供歌曲《此岸的戏事》而出道，擅长提供摇滚歌曲，其个人喜欢民谣。

该曲目以曲速节奏多变为特点，拥有大量的zure。一般难点集中在其罕见的谱面组合中。

曲名为拉丁文，意为「<s>死兆星</s>凶星」。

